SELECT ORDERS.O_SHIPPRIORITY, CUSTOMER.C_NATIONKEY, LINEITEM.L_RECEIPTDATE FROM LINEITEM JOIN ORDERS ON ORDERS.O_ORDERKEY=LINEITEM.L_ORDERKEY JOIN CUSTOMER ON CUSTOMER.C_CUSTKEY=ORDERS.O_CUSTKEY WHERE ORDERS.O_ORDERKEY >= 67 ORDER BY LINEITEM.L_RECEIPTDATE ASC, ORDERS.O_SHIPPRIORITY ASC, CUSTOMER.C_NATIONKEY ASC;
